import styled from "styled-components";
const AddFriendModal = (props) => {
  const { close } = props;
  return (
    <Wrapper>
      <button onClick={close}>CLOSE</button>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  width: 50%;
  height: 50%;
  background-color: white;
`;

export default AddFriendModal;
